import classes from './ArchiveClasses.module.css';

const ArchiveClasses = ({href, classNum}) => {
  return (
    <div className={classes.ClassesItem}>
      <a target='_blank' href={href} className={classes.ClassesItem}>{classNum} класс</a>
    </div>
  )
}

export default ArchiveClasses;
